<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Paisaje estilo Snoopy</title>
<style>
  body, html {
    margin: 0;
    padding: 0;
    height: 100%;
    overflow: hidden;
    background: linear-gradient(to top, #87ceeb 0%, #cce7ff 100%);
    font-family: sans-serif;
  }

  /* Sol animado */
  .sun {
    position: absolute;
    top: 50px;
    right: 50px;
    width: 100px;
    height: 100px;
    background: radial-gradient(circle, #fff200, #ffdd00);
    border-radius: 50%;
    box-shadow: 0 0 60px #ffdd00, 0 0 120px #ffdd00;
    animation: shine 3s ease-in-out infinite alternate;
  }

  @keyframes shine {
    0% { transform: scale(1); }
    100% { transform: scale(1.1); }
  }

  /* Nubes caricaturescas */
  .cloud {
    position: absolute;
    background: white;
    border-radius: 50%;
    opacity: 0.9;
  }

  .cloud1 {
    width: 120px;
    height: 60px;
    top: 80px;
    left: -150px;
    animation: moveCloud 60s linear infinite;
  }
  .cloud1::before, .cloud1::after {
    content: '';
    position: absolute;
    background: white;
    border-radius: 50%;
  }
  .cloud1::before { width: 80px; height: 40px; top: -20px; left: 20px;}
  .cloud1::after { width: 60px; height: 30px; top: 10px; left: 60px;}

  .cloud2 {
    width: 100px;
    height: 50px;
    top: 150px;
    left: -200px;
    animation: moveCloud 90s linear infinite;
  }
  .cloud2::before, .cloud2::after {
    content: '';
    position: absolute;
    background: white;
    border-radius: 50%;
  }
  .cloud2::before { width: 70px; height: 35px; top: -15px; left: 15px;}
  .cloud2::after { width: 50px; height: 25px; top: 5px; left: 50px;}

  @keyframes moveCloud {
    0% { left: -200px; }
    100% { left: 100%; }
  }

  /* Casita de perro caricaturesca (tipo Snoopy) */
  .house {
    position: absolute;
    bottom: -18px;
    right: 50px;
    width: 170px;
    height: 360px;
    filter: drop-shadow(0 10px 0 rgba(0,0,0,0.2));
  }

  .roof {
    position: absolute;
    top: -68px;
    left: -15px;
    width: 315px;
    height: 90px;
    background: #ff2d2d;
    border: 8px solid #111;
    border-bottom: 12px solid #d11f1f;
    transform: skewX(-5deg);
    box-shadow: 0 8px 0 #9c1414;
    z-index: 2;
  }
  .roof::before {
    content: '';
    position: absolute;
    left: 8px;
    right: 8px;
    top: 46px;
    height: 6px;
    background: #111;
    opacity: 0.9;
  }
  .roof::after {
    content: '';
    position: absolute;
    left: -8px;
    right: -8px;
    bottom: -12px;
    height: 12px;
    background: #d11f1f;
    border: 5px solid #111;
    box-shadow: 0 2px 0 #8f0f0f;
  }

  .walls {
    width: 270px;
    height: 270px;
    background:
      repeating-linear-gradient(
        to bottom,
        rgba(0,0,0,0.15) 0 2px,
        transparent 2px 44px
      ),
      linear-gradient(#ff3b3b, #ff3b3b);
    position: relative;
    top: 0;
    border: 8px solid #111;
    border-bottom-left-radius: 6px;
    border-bottom-right-radius: 6px;
    box-shadow: 0 6px 0 #d11f1f;
  }

  .walls::after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 50%;
    transform: translateX(-50%);
    width: 120px;
    height: 150px;
    background: #1a1a1a;
    border: 8px solid #111;
    border-radius: 120px 120px 0 0 / 150px 150px 0 0;
    box-shadow: 0 -6px 0 rgba(0,0,0,0.18) inset;
  }

  .ground {
    position: absolute;
    bottom: 0;
    width: 100%;
    height: 50px;
    background: #7cfc00;
    border-top: 4px solid #32cd32;
    z-index: 2;
  }

  .left-svg {
  position: absolute;
  left: 0;
  bottom: 50px;
  transform: none;
  width: min(95vw, 780px);
  max-height: calc(100dvh - 50px);
  pointer-events: none;
  z-index: 1;
  overflow: hidden;
  animation: svgFloat 6s ease-in-out infinite alternate, svgSway 9s ease-in-out infinite alternate;
}

  .left-svg svg {
    width: 100%;
    height: auto;
  }
/* Vivus drawing states: draw stroke first, reveal fills after */
  #mainSVG.drawing path {
    fill: none !important;
    stroke: #111;
    stroke-width: 2;
    stroke-linecap: round;
    stroke-linejoin: round;
  }
  #mainSVG.drawn path {
    stroke: none;
  }
</style>
</head>
<body>

<div class="sun"></div>
<div class="cloud cloud1"></div>
<div class="cloud cloud2"></div>
